class Solution:
    def makeTheIntegerZero(self, num1: int, num2: int) -> int:
        if num2 == 0:
            return -1
        operations = 0
        while num1 != 0:
            found = False
            for i in range(60, -1, -1):
                if (2**i + num2) == 0: continue
                if (num1 - num2) % (2**(i+1)) == 0:
                    num1 -= (2**i + num2)
                    operations += 1
                    found = True
                    break
            if not found:
                return -1
        return operations
